import React from 'react';
import styled from 'styled-components';
import Slider from "react-slick";
import "slick-carousel/slick/slick.css"; 
import "slick-carousel/slick/slick-theme.css";
import StoryEle from './storyEle';

const StoryDiv=styled.div`
  border-radius:3px;
  border:solid 1px #dbdbdb;
  padding:16px 0;
  width:500px;
  height:100px;
`
function Story() {
  const setting={
    dots:true,
    sliderToShow:5,
    sliderToScroll:5,
    speed:500,
    arrow:true
  }
  return (
    <StoryDiv>
      <Slider {...setting}>
          <div><StoryEle></StoryEle></div>
          <div><StoryEle></StoryEle></div>
          <div><StoryEle></StoryEle></div>
          <div><StoryEle></StoryEle></div>
          <div><StoryEle></StoryEle></div>
          <div><StoryEle></StoryEle></div>
          <div><StoryEle></StoryEle></div>
          <div><StoryEle></StoryEle></div>
          <div><StoryEle></StoryEle></div>
          <div><StoryEle></StoryEle></div>
          <div><StoryEle></StoryEle></div>
          <div><StoryEle></StoryEle></div>
          {/* <StoryEle></StoryEle>
          <StoryEle></StoryEle>
          <StoryEle></StoryEle>
          <StoryEle></StoryEle>
          <StoryEle></StoryEle>
          <StoryEle></StoryEle>
          <StoryEle></StoryEle>
          <StoryEle></StoryEle>
          <StoryEle></StoryEle>
          <StoryEle></StoryEle>
          <StoryEle></StoryEle>
          <StoryEle></StoryEle>
          <StoryEle></StoryEle>
          <StoryEle></StoryEle>
          <StoryEle></StoryEle> */}
      </Slider>
    </StoryDiv>
  );
}

export default Story;
